import React, { useState, useEffect, useRef } from 'react';
import styled, { keyframes } from 'styled-components';
import { CelestialBody, Flower, EmotionType } from '../types';
import {
  moonImage,
  starIcon,
  meteorIcon,
  flower1Icon,
  flower2Icon,
  flower3Icon
} from '../assets';

const rotate = keyframes`
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
`;

const float = keyframes`
  0% { transform: translateY(0); }
  50% { transform: translateY(-10px); }
  100% { transform: translateY(0); }
`;

const MoonContainer = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 300px;
  height: 300px;
  z-index: 1;
`;

const MoonSphere = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  background: url(${moonImage}) no-repeat center center;
  background-size: cover;
  animation: ${rotate} 60s linear infinite;
  position: relative;
  box-shadow: inset -25px -25px 40px rgba(0,0,0,0.3);
`;

const CelestialBodyContainer = styled.div<{ x: number; y: number; type: EmotionType }>`
  position: absolute;
  left: ${props => props.x}px;
  top: ${props => props.y}px;
  cursor: pointer;
  width: 48px;
  height: 48px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  background-image: ${props =>
    props.type === 'positive'
      ? `url(${starIcon})`
      : props.type === 'negative'
        ? `url(${meteorIcon})`
        : `url(${starIcon})`};
  animation: ${float} 6s ease-in-out infinite;
  filter: ${props => props.type === 'received' ? 'hue-rotate(90deg)' : 'none'};

  &:hover {
    transform: scale(1.2);
    filter: brightness(1.2) ${props => props.type === 'received' ? 'hue-rotate(90deg)' : 'none'};
    z-index: 10;
  }
`;

const FlowerContainer = styled.div<{ x: number; y: number; style: string }>`
  position: absolute;
  left: ${props => props.x}px;
  top: ${props => props.y}px;
  width: 32px;
  height: 32px;
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
  background-image: ${props => {
    switch (props.style) {
      case 'flower1':
        return `url(${flower1Icon})`;
      case 'flower2':
        return `url(${flower2Icon})`;
      case 'flower3':
        return `url(${flower3Icon})`;
      default:
        return `url(${flower1Icon})`;
    }
  }};
`;

const Tooltip = styled.div`
  position: absolute;
  background: rgba(0, 0, 0, 0.8);
  color: white;
  padding: 8px 12px;
  border-radius: 4px;
  font-size: 14px;
  max-width: 200px;
  word-wrap: break-word;
  z-index: 1000;
  pointer-events: none;
  transition: opacity 0.3s;
  opacity: 0;

  ${CelestialBodyContainer}:hover & {
    opacity: 1;
  }
`;

interface MoonProps {
  celestialBodies: CelestialBody[];
  flowers?: Flower[];
}

export const Moon: React.FC<MoonProps> = ({ celestialBodies, flowers = [] }) => {
  const [positions, setPositions] = useState<Record<string, { x: number; y: number }>>({});
  const [hoveredBody, setHoveredBody] = useState<CelestialBody | null>(null);
  const currentQuadrantRef = useRef(0);

  useEffect(() => {
    const generatePositions = () => {
      const newPositions: Record<string, { x: number; y: number }> = { ...positions };

      const quadrants = [
        { name: "右上", startX: 650, endX: 1200, startY: 20, endY: 300 },   // 第一象限
        { name: "左上", startX: 20, endX: 550, startY: 20, endY: 300 },     // 第二象限
        { name: "左下", startX: 20, endX: 550, startY: 400, endY: 700 },    // 第三象限
        { name: "右下", startX: 650, endX: 1200, startY: 400, endY: 700 }   // 第四象限
      ];

      const moonCenterX = 600;
      const moonCenterY = 350;

      const newBodies = celestialBodies.filter(body => !positions[body.id]);

      newBodies.forEach((body) => {
        const quadrantIndex = currentQuadrantRef.current;
        currentQuadrantRef.current = (currentQuadrantRef.current + 1) % 4;

        const quadrant = quadrants[quadrantIndex];
        console.log(`为星星 ${body.id} 分配象限: ${quadrant.name}`);

        const x = Math.floor(Math.random() * (quadrant.endX - quadrant.startX) + quadrant.startX);
        const y = Math.floor(Math.random() * (quadrant.endY - quadrant.startY) + quadrant.startY);

        newPositions[body.id] = { x, y };
      });

      setPositions(newPositions);
    };

    generatePositions();
  }, [celestialBodies]);

  return (
    <MoonContainer>
      <MoonSphere>
        {flowers.map(flower => (
          <FlowerContainer
            key={flower.id}
            x={flower.position.x}
            y={flower.position.y}
            style={flower.style}
          />
        ))}
      </MoonSphere>
      {celestialBodies.map(body => {
        const pos = positions[body.id] || { x: 0, y: 0 };
        return (
          <CelestialBodyContainer
            key={body.id}
            x={pos.x}
            y={pos.y}
            type={body.type}
            onMouseEnter={() => setHoveredBody(body)}
            onMouseLeave={() => setHoveredBody(null)}
          >
            <Tooltip>{body.content}</Tooltip>
          </CelestialBodyContainer>
        );
      })}
    </MoonContainer>
  );
};
